  false,\n\t\"url\": null,\n\t\"notes\": \"Accurate delineations of irrigated acreage
  are needed for the development of water-use estimates and in determining water-budget
  calculations for the Basin and Range carbonate-rock aquifer system (BARCAS) study.
  ISatellite imagery from the Landsat Thematic Mapper and Enhanced Thematic Mapper
  platforms were used to delineate irrigated acreage on a field-by-field basis for
  the entire study area. Six hundred and forty-three fields were delineated. The water
  source, irrigation system, crop type, and field activity for 2005 were identified
  and verified through field reconnaissance.\",\n\t\"license_title\": null,\n\t\"extras\":
